import React from "react";
import { motion } from "framer-motion";
import data from "../data/packages.json";
import { toIDR } from "../utils/format";

/** Variants untuk daftar + item (stagger) */
const listVariants = {
  hidden: { opacity: 0 },
  show: {
    opacity: 1,
    transition: { staggerChildren: 0.06, delayChildren: 0.05 }
  }
};

const itemVariants = {
  hidden: { opacity: 0, y: 10 },
  show: { opacity: 1, y: 0, transition: { duration: 0.28, ease: "easeOut" } }
};

export default function Explore() {
  return (
    <div className="container mt-6 space-y-4">
      <motion.h1
        initial={{ opacity: 0, y: 10 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.35, ease: "easeOut" }}
        className="text-2xl font-bold text-slate-900 dark:text-slate-100"
      >
        Explore Paket
      </motion.h1>

      <motion.div
        variants={listVariants}
        initial="hidden"
        animate="show"
        className="grid md:grid-cols-2 gap-4"
      >
        {data.map(p => (
          <motion.div key={p.id} variants={itemVariants} className="card p-4">
            <details>
              <summary className="cursor-pointer font-semibold text-slate-900 dark:text-slate-100">
                {p.title}
              </summary>

              <div className="mt-3 grid md:grid-cols-2 gap-3">
                <div>
                  {p.spots && (
                    <>
                      <h4 className="font-medium">Spot Wisata:</h4>
                      <ul className="list-disc ml-5 text-sm">
                        {p.spots.map((s, i) => <li key={i}>{s}</li>)}
                      </ul>
                    </>
                  )}

                  {p.spots_day1 && (
                    <>
                      <h4 className="font-medium">Hari 1:</h4>
                      <ul className="list-disc ml-5 text-sm">
                        {p.spots_day1.map((s, i) => <li key={i}>{s}</li>)}
                      </ul>
                      <h4 className="font-medium mt-2">Hari 2:</h4>
                      <ul className="list-disc ml-5 text-sm">
                        {p.spots_day2.map((s, i) => <li key={i}>{s}</li>)}
                      </ul>
                    </>
                  )}

                  {p.snorkeling && (
                    <>
                      <h4 className="font-medium mt-2">Spot Snorkeling:</h4>
                      <ul className="list-disc ml-5 text-sm">
                        {p.snorkeling.map((s, i) => <li key={i}>{s}</li>)}
                      </ul>
                    </>
                  )}
                </div>

                <div>
                  {p.include && (
                    <>
                      <h4 className="font-medium">Termasuk:</h4>
                      <ul className="list-disc ml-5 text-sm">
                        {p.include.map((s, i) => <li key={i}>{s}</li>)}
                      </ul>
                    </>
                  )}

                  {p.priceTiers && (
                    <>
                      <h4 className="font-medium mt-2">Harga per Pax:</h4>
                      <ul className="list-disc ml-5 text-sm">
                        {p.priceTiers.map(([n, price]) => (
                          <li key={n}>{n} pax: {toIDR(price)}</li>
                        ))}
                      </ul>
                    </>
                  )}

                  {p.note && (
                    <p className="text-sm text-slate-500 dark:text-slate-400 mt-2">
                      {p.note}
                    </p>
                  )}
                </div>
              </div>
            </details>
          </motion.div>
        ))}
      </motion.div>
    </div>
  );
}
